INSERT INTO `tyres` (`id`, `publish`, `region_id`, `country_id`, `brand_id`, `search_tag_id`, `season_id`, `name`, `preview_name`, `slug`, `external_link`, `order`, `description`, `catalogue_image`, `product_images`, `features_benifits`, `sizes`, `premium_tyre`, `deleted_at`, `created_at`, `updated_at`) VALUES
(77, 1, 14, 16, 17, 23, 2, 'All Season EV', 'All Season EV', 'us-all-season-ev', NULL, 0, 'The All Season EV is a premium tire range that has been engineered and intensively tested to meet the specific requirements of the latest Electric Vehicles (EVs). This range offers lower rolling resistance for increased EV range, enhanced safety and stability in all seasons, high mileage as well as a quiet and comfortable driving experience. An ideal choice for the latest EVs. \r\n\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;40,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'All-Season-EV.webp', '[\"all-season-ev-0.webp\",\"all-season-ev-45.webp\",\"all-season-ev-90.webp\"]', '[{\"title\":\"STABILOAD COMPOUND \\u2013 EXCEPTIONAL GRIP, STABILITY AND  &lt;br class=&#039;hidden-xs&#039;&gt;INCREASED EV RANGE\",\"description\":\"Advanced compound that provides both exceptional grip and stability, answering the  &lt;br class=&#039;hidden-xs&#039;&gt;specific demands of EVs in all weather conditions. Optimized silica-silane coupling reduces rolling  &lt;br class=&#039;hidden-xs&#039;&gt;resistance to offer  increased EV range.\",\"image\":\"All-Season-EV_FB-1.webp\"},{\"title\":\"ULTRAREACT SIDEWALL \\u2013 ENHANCED SAFETY  &lt;br class=&#039;hidden-xs&#039;&gt;AND STABILITY\",\"description\":\"This technology provides a reinforced lower sidewall construction that  &lt;br class=&#039;hidden-xs&#039;&gt;provides stiffness and stability when needed for making those crucial and  &lt;br class=&#039;hidden-xs&#039;&gt;sudden avoidance maneuvers.\",\"image\":\"All-Season-EV_FB-2.webp\"},{\"title\":\"DURATOUGH TECHNOLOGY \\u2013  &lt;br class=&#039;hidden-xs&#039;&gt;HIGH MILEAGE\",\"description\":\"Optimized technology comprising of a combination of a stiff yet low heat build-up  &lt;br class=&#039;hidden-xs&#039;&gt;compound, with dense siping on the tread and a robust construction provides a very balanced  &lt;br class=&#039;hidden-xs&#039;&gt;footprint for a long-lasting trouble-free driving experience.\",\"image\":\"All-Season-EV_FB-3.webp\"},{\"title\":\"STEALTH TECHNOLOGY&lt;sup&gt;TM&lt;\\/sup&gt; - &lt;br class=&#039;hidden-xs&#039;&gt;LOW NOISE\",\"description\":\"Fine-tuned construction and optimized variable tread pitch sequencing provide a quiet and  &lt;br class=&#039;hidden-xs&#039;&gt;comfortable ride by damping the noise and eliminating the generation of irritating sound  &lt;br class=&#039;hidden-xs&#039;&gt;resonances from the tread pattern.\",\"image\":\"All-Season-EV_FB-4.webp\"}]', '{\"sizes\":[{\"name\":\"us-all-season-ev\",\"size\":20,\"rim\":\"255\\/40R20\",\"li_sr\":\"101W\",\"lr\":\" XL \",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-all-season-ev\",\"size\":19,\"rim\":\"235\\/40R19\",\"li_sr\":\"96W\",\"lr\":\" XL \",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-all-season-ev\",\"size\":19,\"rim\":\"245\\/45R19\",\"li_sr\":\"102W\",\"lr\":\" XL \",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-all-season-ev\",\"size\":19,\"rim\":\"255\\/45R19\",\"li_sr\":\"104W\",\"lr\":\" XL \",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-all-season-ev\",\"size\":18,\"rim\":\"235\\/45R18\",\"li_sr\":\"98W\",\"lr\":\" XL \",\"fuel\":null,\"weather\":null,\"noise_db\":null}],\"extra_cols\":[],\"legends\":\"&lt;strong&gt;L.I.&lt;\\/strong&gt; = Load Index, &lt;strong&gt;S.R.&lt;\\/strong&gt; = Speed Rating, &lt;strong&gt;L.R.&lt;\\/strong&gt; = Load Range, &lt;strong&gt;E.V.&lt;\\/strong&gt; = Electric Vehicle, &lt;strong&gt;M+S&lt;\\/strong&gt; = Mud and Snow, \\r\\n&lt;br&gt;&lt;strong&gt;Speed Rating:&lt;\\/strong&gt; &lt;strong&gt;W&lt;\\/strong&gt; = 168 mph, &lt;strong&gt;Load Range: XL&lt;\\/strong&gt; = Extra Load.\"}', 1, NULL, '2025-01-11 12:15:32', '2025-04-24 06:52:57'),
(78, 1, 14, 16, 17, 23, 2, 'DIMAX A/S-9', 'Dimax&lt;sup&gt;&lt;/sup&gt; A/S-9', 'us-dimax-as9', NULL, 2, 'The Dimax A/S-9 is a premium all-season sport touring tire that has been designed to perform on the latest high- performance cars &amp; SUVs. This range provides a combination of exceptional durability and handling in wet and dry conditions making it the ideal choice for drivers looking for high performance in all seasons. It also utilizes a silica-based all-season compound that offers high durability and long tread life while maintaining an excellent grip.\r\n\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;Up to 60,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Dimax_AS9.webp', '[\"Dimax_AS9_0.webp\",\"Dimax_AS9_45.webp\",\"Dimax_AS9_90.webp\"]', '[{\"title\":\"EXCEPTIONAL &lt;br class=&#039;hidden-xs&#039;&gt;ALL-SEASON PERFORMANCE\",\"description\":\"Dense lateral siping provides grip in&lt;br class=&quot;hidden-xs&quot;&gt; wet and snow\",\"image\":\"Dimax_AS9_Feature__Benefits_1.webp\"},{\"title\":\"OUTSTANDING STEERING CONTROL, &lt;br class=&#039;hidden-xs&#039;&gt;PRECISE HANDLING AND CORNERING\",\"description\":\"Large and rigid center rib combined with &lt;br class=&quot;hidden-xs&quot;&gt;large shoulder blocks\",\"image\":\"Dimax_AS9_Feature__Benefits_2.webp\"},{\"title\":\"INCREASED &lt;br class=&#039;hidden-xs&#039;&gt;HYDROPLANING RESISTANCE\",\"description\":\"High-volume longitudinal and &lt;br class=&quot;hidden-xs&quot;&gt;latitudinal grooves\",\"image\":\"Dimax_AS9_Feature__Benefits_3.webp\"},{\"title\":\"HIGH DURABILITY AND IMPROVED GRIP ON &lt;br class=&#039;hidden-xs&#039;&gt;WET AND DRY ROADS\",\"description\":\"Silica-based advanced and adaptive tread compound with an &lt;br class=&quot;hidden-xs&quot;&gt;innovative tread pattern design\",\"image\":\"Dimax_AS9_Feature__Benefits_4.webp\"}]', '{\"sizes\":[{\"name\":\"us-dimax-as9\",\"size\":20,\"rim\":\"235\\/50R20\",\"li_sr\":\"104W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":19,\"rim\":\"235\\/40R19\",\"li_sr\":\"96W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":18,\"rim\":\"225\\/50R18\",\"li_sr\":\"99W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":18,\"rim\":\"235\\/45R18\",\"li_sr\":\"98W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":17,\"rim\":\"205\\/50R17\",\"li_sr\":\"93W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":17,\"rim\":\"215\\/50R17\",\"li_sr\":\"95W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":17,\"rim\":\"215\\/55R17\",\"li_sr\":\"98W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":17,\"rim\":\"225\\/50R17\",\"li_sr\":\"98W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":17,\"rim\":\"225\\/55R17\",\"li_sr\":\"101V\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":17,\"rim\":\"235\\/55R17\",\"li_sr\":\"103W\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":16,\"rim\":\"205\\/55R16\",\"li_sr\":\"94V\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as9\",\"size\":16,\"rim\":\"205\\/60R16\",\"li_sr\":\"96V\",\"lr\":\"XL\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as10\",\"size\":16,\"rim\":\"215\\/55R16\",\"li_sr\":\"97W\",\"lr\":\"XL\",\"fuel\":\