(80, 1, 14, 16, 17, 23, 1, 'DIMAX E-SPORT 1', 'DIMAX&lt;sup&gt;&lt;/sup&gt; E-SPORT 1', 'us-dimax-esport-1', NULL, 4, 'The Dimax e-Sport 1 is the high performance range within the Dimax e-Collection from Radar Tires. This range offers a blend of high performance, increased safety, high mileage and is eco-friendly at the same time. The e-Sport 1 is engineered using a special low rolling resistance compound and light weight construction that minimizes the energy lost from heat, improving the vehicles fuel efficiency and reducing the amount of CO2 emitted into the environment. It also features a Silica-based tread compound that provides added safety through shorter braking distance. \r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;40,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;-blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Dimax_eSport-US.webp', '[\"Dimax_eSport-1.webp\",\"Dimax_eSport-2.webp\",\"Dimax_eSport-3.webp\"]', '[{\"title\":\"PRECISE HANDLING AND STABILITY &lt;br class=&#039;hidden-xs&#039;&gt;AT HIGH SPEEDS\",\"description\":\"Asymmetric tread pattern with a solid outside &lt;br class=&#039;hidden-xs&#039;&gt;shoulder provides stability and precise &lt;br class=&#039;hidden-xs&#039;&gt;handling at high speeds.\",\"image\":\"Dimax_eSport-1-FB_1.webp\"},{\"title\":\"SAVE UP TO $200 IN GAS OVER THE LIFE OF &lt;br class=&#039;hidden-xs&#039;&gt;YOUR TIRE AT $3.75 PER GALLON*\",\"description\":\"Lightweight construction combined with a special tread &lt;br class=&#039;hidden-xs&#039;&gt;compound keeps the tire cooler, helping your engine improve &lt;br class=&#039;hidden-xs&#039;&gt;fuel efficiency and reduce CO2 emissions.\",\"image\":\"Dimax_eSport-1-FB_2.webp\"},{\"title\":\"STOP UP TO 8 FEET SHORTER FOR &lt;br class=&#039;hidden-xs&#039;&gt;ADDED SAFETY**\",\"description\":\"Silica-based tr