etime. Fuel savings are estimates only. Actual on-road savings may vary.&lt;br&gt;\\r\\n**Based on wet braking test with Radar Dimax A\\/S-8, 215\\/60R16 size tire from a speed of 50 mph to 0.\"}', NULL, NULL, '2025-01-11 13:07:43', '2025-04-24 06:52:11'),
(83, 1, 14, 16, 17, 23, 1, 'DIMAX E-TOURING 1', 'DIMAX&lt;sup&gt;&lt;/sup&gt; E-TOURING 1', 'us-dimax-etouring-1', NULL, 8, 'The Dimax e-Touring 1 is a touring range within the Dimax e-Collection from Radar Tires. This range offers a combination of safety, stability and is eco-friendly at the same time. The e-Touring 1 is engineered for high mileage and eco-friendly performance. It utilizes a special low rolling resistance compound and light weight construction that minimizes the energy lost from heat, improving the vehicles fuel efficiency and reducing the amount of CO2 emitted into the environment. It also features a Silica-based tread compound that provides added safety through shorter braking distance.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;45,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Dimax_eTouring_1-US.webp', '[\"Dimax_eTouring_1-1.webp\",\"Dimax-eTouring-1-45.webp\",\"Dimax-eTouring-1-90.webp\"]', '[{\"title\":\"SAVE UP TO $200 IN GAS OVER THE LIFE OF &lt;br class=&#039;hidden-xs&#039;&gt;YOUR TIRE AT $3.75 PER GALLON*\",\"description\":\"Lightweight construction combined with a special &lt;br class=&#039;hidden-xs&#039;&gt;tread compound keeps the tire cooler, helping &lt;br class=&#039;hidden-xs&#039;&gt;your engine improve fuel efficiency and reduce &lt;br class=&#039;hidden-xs&#039;&gt;CO2 emissions.\",\"image\":\"Dimax_eTouring_1-FB_1.webp\"},{\"title\":\"STOP UP TO 8 FEET SHORTER &lt;br class=&#039;hidden-xs&#039;&gt;FOR ADDED SAFETY**\",\"description\":\"Silica-based tread compound &lt;br class=&#039;hidden-xs&#039;&gt;provides no compromize braking, &lt;br class=&#039;hidden-xs&#039;&gt;that results up to 8 feet shorter &lt;br class=&#039;hidden-xs&#039;&gt;stopping distance.\",\"image\":\"Dimax_eTouring_1-FB_2.webp\"},{\"title\":\"QUIETNESS FOR A MORE &lt;br class=&#039;hidden-xs&#039;&gt;COMFORTABLE RIDE\",\"description\":\"Computer optimized tread pitch &lt;br class=&#039;hidden-xs&#039;&gt;sequence combined with a light &lt;br class=&#039;hidden-xs&#039;&gt;weight construction for a quiet and &lt;br class=&#039;hidden-xs&#039;&gt;comfortable ride.\",\"image\":\"Dimax_eTouring_1-FB_3.webp\"}]', '{\"sizes\":[{\"name\":\"us-dimax-etouring-1\",\"size\":16,\"rim\":\"205\\/55R16\",\"li_sr\":\"91V\",\"lr\":\"-\",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-dimax-etouring-1\",\"size\":16,\"rim\":\"205\\/60R16\",\"li_sr\":\"92H\",\"lr\":\"-\",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-dimax-etouring-1\",\"size\":15,\"rim\":\"185\\/65R15\",\"li_sr\":\"88H\",\"lr\":\"-\",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-dimax-etouring-1\",\"size\":15,\"rim\":\"195\\/60R15\",\"li_sr\":\"88H\",\"lr\":\"-\",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-dimax-etouring-1\",\"size\":15,\"rim\":\"195\\/65R15\",\"li_sr\":\"91H\",\"lr\":\"-\",\"fuel\":null,\"weather\":null,\"noise_db\":null},{\"name\":\"us-dimax-etouring-1\",\"size\":15,\"rim\":\"205\\/65R15\",\"li_sr\":\"94H\",\"lr\":\"-\",\"fuel\":null,\"weather\":null,\"noise_db\":null}],\"extra_cols\":[],\"legends\":\"&lt;strong&gt;L.I.&lt;\\/strong&gt; = Load Index, &lt;strong&gt;S.R.&lt;\\/strong&gt; = Speed Rating, &lt;strong&gt;L.R.&lt;\\/strong&gt; = Load Range, &lt;strong&gt;M+S&lt;\\/strong&gt; = Mud and Snow.&lt;br&gt;&lt;strong&gt;Speed Rating: H&lt;\\/strong&gt; = 130 mph, &lt;strong&gt;V&lt;\\/strong&gt; = 149 mph\\r\\n&lt;br&gt;&lt;br&gt;\\r\\n*Based on rolling resistance test with Radar Dimax A\\/S-8, 215\\/60R16 size. Car&#039;s fuel consumption approx. 3.5-4 gallons\\/100 miles. Estimated 40,000-45,000 miles during the tire&#039;s lifetime. Fuel savings are estimates only. Actual on-road savings may vary.\\r\\n&lt;br&gt;**Based on wet braking test with Radar Dimax A\\/S-8, 215\\/60R16 size tire from a speed of 50 mph to 0.\"}', NULL, NULL, '2025-01-11 13:11:32', '2025-04-24 06:52:05'),
(84, 1, 14, 16, 17, 23, 2, 'DIMAX A/S-6', 'Dimax&lt;sup&gt;&lt;/sup&gt; A/S-6', 'us-dimax-as-6', NULL, 9, 'The Dimax AS-6 is the new all-season touring tire that has been designed and developed especially for small to mid-sized passenger cars. This range features a state-of-the-art silica based tread compound which ensures exceptional handling in all conditions and balanced wear giving confidence and good value to the discerning customer. The large number of lateral sipes coupled with an innovative tread pattern design and the latest materials ensure outstanding mechanical grip in both dry and wet conditions making it an ideal choice for optimal all-season performance.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;50,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Dimax_AS6-us.webp', '[\"Dimax_AS6_(0)S-19.webp\",\"Dimax_AS6_(45)_S-19.webp\",\"Dimax_AS6_(90)_S-19.webp\"]', '[{\"title\":\"OPTIMAL ALL-SEASON PERFORMANCE\",\"description\":\"Silica based tread compound coupled with large number of lateral sipes offer&lt;br class=&quot;hidden-xs&quot;&gt; outstanding mechanical grip in dry and wet conditions.\",\"image\":\"Dimax-AS6_FB-1.webp\"},{\"title\":\"LONG LIFE (UTQG: 600 A A)\",\"description\":\"Innovative design coupled with the best compounds ensure that the tire&lt;br class=&quot;hidden-xs&quot;&gt; wears evenly and gives long life.\",\"image\":\"Dimax-AS6_FB-2.webp\"},{\"title\":\"QUIET AND COMFORTABLE RIDE\",\"description\":\"Optimized materials ensure good handling, a comfortable &lt;br class=&quot;hidden-xs&quot;&gt;ride and low noise.\",\"image\":\"Dimax-AS6_FB-3.webp\"}]', '{\"sizes\":[{\"name\":\"us-dimax-as-6\",\"size\":15,\"rim\":\"185\\/60R15\",\"li_sr\":\"104W\",\"lr\":\" XL \",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-dimax-as-6\",\"size\":15,\"rim\"