INSERT INTO `tyres` (`id`, `publish`, `region_id`, `country_id`, `brand_id`, `search_tag_id`, `season_id`, `name`, `preview_name`, `slug`, `external_link`, `order`, `description`, `catalogue_image`, `product_images`, `features_benifits`, `sizes`, `premium_tyre`, `deleted_at`, `created_at`, `updated_at`) VALUES
(85, 1, 14, 16, 17, 23, 3, 'DIMAX ALL WEATHER', 'DIMAX&lt;sup&gt;&lt;/sup&gt; ALL WEATHER', 'us-dimax-all-weather', NULL, 10, 'The Dimax All Weather is a premium All Weather tire, engineered to provide optimal performance in any weather condition. Our 3PMSF marking allows drivers to drive with confidence and safety in both scorching summer heat and in snow covered winter roads without needing a seasonal tire change. Designed by Omni United in collaboration with renowned Italian design house GFG Style, led by legendary automotive designers Giorgetto and Fabrizio Giugiaro, the Dimax All Weather features a unique, functional and stylish design representing a perfect synergy of design and engineering. This advanced and feature packed range is extensively tested against premium brands and provides optimal performance in all weather conditions providing drivers with confidence, safety and control. The Dimax All Weather offers popular passenger car and SUV fitments and all sizes are EV(Electric Vehicle) and Plug-in hybrid vehicle compatible.', 'Dimax-All-Season-featured.webp', '[\"US--Dimax_All_Weather--0.webp\",\"US--Dimax_All_Weather--45.webp\",\"US--Dimax_All_Weather--90.webp\"]', '[{\"title\":\"TRIPLE-EDGED PATTERN DESIGN\",\"description\":\"Sawtooth shaped center grooves together with the step-design of the outer circumferential grooves &lt;br class=&#039;hidden-xs&#039;&gt;providing outstanding mechanical grip on snow. This design enables the use of very stiff pattern &lt;br class=&#039;hidden-xs&#039;&gt;blocks delivering optimal performance on wet and dry roads.\",\"image\":\"Dimax-All-Season_FB_1.webp\"},{\"title\":\"BLUE SILICA COMPOUND\",\"description\":\"Advanced wet grip silica compound designed to deliver ultimate safety on wet roads while performing &lt;br class=&#039;hidden-xs&#039;&gt;on dry roads. It has been fine-tuned to deliver exceptional all season performance, high durability &lt;br class=&#039;hidden-xs&#039;&gt;and excellent resistance to tire aging.\",\"image\":\"Dimax-All-Season_FB_2.webp\"},{\"title\":\"AQUEDUCT GROOVES\",\"description\":\"These are ultra-smooth and shiny channels which, in combination with optimized groove wall &lt;br class=&#039;hidden-xs&#039;&gt;angles help in efficiently evacuating water and slush from the tread, reducing the risk of &lt;br class=&#039;hidden-xs&#039;&gt;aquaplaning and enhancing safety.\",\"image\":\"US--Dimax-All-Season_FB_3.webp\"},{\"title\":\"CONNECTED SUPPORT TECHNOLOGY\",\"description\":\"Innovative structural element embedded within the tire\\u2019s tread pattern, providing full support &lt;br class=&#039;hidden-xs&#039;&gt;to all the tread blocks from shoulder to shoulder ensuring tire integrity, precise steering, &lt;br class=&#039;hidden-xs&#039;&gt;and safety in extreme driving conditions.\",\"image\":\"Dimax-All-Season_FB_4.webp\"},{\"title\":\"CIRCLE OF TREADLIFE\",\"description\":\"A unique safety feature that indicates remaining tread depth. When the tire is new, this indicator is &lt;br class=&#039;hidden-xs&#039;&gt;a full circle with 8-millimeters of tread remaining. As the tire wears down, the indicator begins to &lt;br class=&#039;hidden-xs&#039;&gt;fade and totally disappears at a groove depth of 2 millimeters.\",\"image\":\"Dimax-All-Season_FB_5.webp\"},{\"title\":\"SMOOTH VELVET SIDEWALL\",\"description\":\"Ultra-low protrusion, which improves &lt;br class=&#039;hidden-xs&#039;&gt;the tire\\u2019s air drag factor and is &lt;br class=&#039;hidden-xs&#039;&gt;easy to clean.\",\"image\":\"US--Dimax-All--Weather--FB-6.webp\"}]', '{\"sizes\":[{\"name\":\"us-dimax-all-weather\",\"size\":18,\"rim\":\"215\\/55R18\",\"li_sr\":\"99V\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"eu-dimax-r8-plus-0\",\"exempted\":1},{\"name\":\"us-dimax-all-weather\",\"size\":18,\"rim\":\"225\\/40R18\",\"li_sr\":\"92Y\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"eu-dimax-r8-plus-1\",\"exempted\":0},{