b&gt;L.R.&lt;\\/b&gt; = Load Range, &lt;b&gt;EVC&lt;\\/b&gt; = Electric Vehicle Compatible, &lt;b&gt;3PMSF&lt;\\/b&gt; = 3 Peak Mountain Snowflake, &lt;b&gt;M+S&lt;\\/b&gt; = Mud and Snow. \\r\\n&lt;br&gt;&lt;b&gt;Speed Rating:&lt;\\/b&gt; &lt;b&gt;T&lt;\\/b&gt; = 118 mph, &lt;b&gt;H&lt;\\/b&gt; = 130 mph, &lt;b&gt;V&lt;\\/b&gt; = 149 mph, &lt;b&gt;W&lt;\\/b&gt; = 168 mph, &lt;b&gt;Y&lt;\\/b&gt; = 186 mph | &lt;b&gt;Load Range:&lt;\\/b&gt; &lt;b&gt;SL&lt;\\/b&gt; = Standard Load &lt;b&gt;XL&lt;\\/b&gt; = Extra Load\"}', 1, NULL, '2025-01-11 13:20:09', '2025-04-24 06:51:54'),
(86, 1, 14, 16, 17, 23, 3, 'DIMAX WINTER', 'DIMAX&lt;sup&gt;&lt;/sup&gt; WINTER', 'us-dimax-winter', NULL, 11, 'The Dimax Winter is a premium Winter tire, engineered to excel in harsh and demanding winter conditions, providing drivers with confidence, safety, and control. Designed by Omni United in collaboration with renowned Italian design house GFG Style, led by legendary automotive designers Giorgetto and Fabrizio Giugiaro, the Dimax Winter features a unique, functional and stylish design representing a perfect synergy of design and engineering. This advanced and feature packed range is extensively tested against premium brands and provides ultimate snow performance, outstanding safety on wet and slush, and top-of-the-class braking performance in all conditions. The Dimax Winter offers popular passenger car and SUV fitments and all sizes are EV(Electric Vehicle) and Plug-in hybrid vehicle compatible.\r\n\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;Road Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Dimax-Winter_featured.webp', '[\"Dimax-Winter_0-degree.webp\",\"Dimax-Winter_45-degree.webp\",\"Dimax-Winter_90-degree.webp\"]', '[{\"title\":\"DOUBLE CRYSTAL 3D SIPES\",\"description\":\"Three dimensional sipes resembling crystals, precisely &lt;br class=&#039;hidden-xs&#039;&gt;positioned across the tire\\u2019s tread in order to maximize &lt;br class=&#039;hidden-xs&#039;&gt;extreme grip on snow and ice, as well as provide &lt;br class=&#039;hidden-xs&#039;&gt;stability on wet and dry roads\",\"image\":\"Dimax-Winter_FB_1.webp\"},{\"title\":\"INARI COMPOUND\",\"description\":\"Advanced silica compound tested and perfected in harsh winter conditions of the &lt;br class=&#039;hidden-xs&#039;&gt;Northern Finnish Lapland. It has been fine-tuned to deliver exceptional winter &lt;br class=&#039;hidden-xs&#039;&gt;performance, excellent wet grip, low rolling resistance, high durability and &lt;br class=&#039;hidden-xs&#039;&gt;excellent resistance to tire aging.\",\"image\":\"Dimax-Winter_FB_2.webp\"},{\"title\":\"AQUEDUCT GROOVES\",\"description\":\"These are ultra-smooth and shiny channels which, in combination &lt;br class=&#039;hidden-xs&#039;&gt;with optimized groove wall angles help in efficiently evacuating &lt;br class=&#039;hidden-xs&#039;&gt;water and slush from the tread, reducing the risk of aquaplaning &lt;br class=&#039;hidden-xs&#039;&gt;and enhancing safety.\",\"image\":\"Dimax-Winter_FB_3.webp\"},{\"title\":\"CONNECTED SUPPORT TECHNOLOGY\",\"description\":\"Innovative structural element embedded within the tire\\u2019s tread &lt;br class=&#039;hidden-xs&#039;&gt;pattern, providing full support to all the tread blocks from shoulder &lt;br class=&#039;hidden-xs&#039;&gt;to shoulder ensuring tire integrity, precise steering, and safety in &lt;br class=&#039;hidden-xs&#039;&gt;extreme driving conditions.\",\"image\":\"Dimax-Winter_FB_4.webp\"},{\"title\":\"CIRCLE OF TREADLIFE\",\"description\":\"A unique safety feature that indicates remaining tread depth. When the tire is &lt;br class=&#039;hidden-xs&#039;&gt;new, this indicator is a full circle with 8-millimeters of tread remaining. As &lt;br class=&#039;hidden-xs&#039;&gt;the tire wears down, the indicator begins to fade and totally disappears at a &lt;br class=&#039;hidden-xs&#039;&gt;groove depth of 2 millimeters.\",\"image\":\"Dimax-Winter_FB_5.webp\"},{\"title\":\"SMOOTH VELVET SIDEWALL\",\"description\":\"Ultra-low protrusion, which &lt;br class=&#039;hidden-xs&#039;&gt;improves the tire\\u2019s air &lt;br class=&#039;hidden-xs&#039;&gt;drag factor and is &lt;br class=&#039;hidden-xs&#039;&gt;easy to clean.\",\"image\":\"Dimax-Winter_FB_6.webp\"}]', '{\"sizes\":[{\"name\":\"us-dimax-winter\",\"size\":20,\"rim\":\"275\\/40R20\",\"li_sr\":\"106V\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_d