(87, 1, 14, 16, 17, 30, 2, 'ANGLER ST-100', 'ANGLER ST-100', 'us-angler-st-100', NULL, 0, 'The Angler ST-100 is a special purpose trailer tire developed specifically for use on travel trailers, pop-up campers, boat trailers, toy haulers and fifth wheels. This range features a rounded profile which helps improve ride quality. Its symmetric tread design with closely spaced ribs provides increased contact patch for straight tracking and highway stability. The construction of the ST-100 features twin steel belts with a nylon overlay and polyester body-ply which provides stability, puncture resistance and durability. The range also utilizes a special compound that offers increased mileage and fuel efficiency.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Angler-ST-100-us_feature.webp', '[\"Angler-ST_100.webp\",\"Angler-ST_100_(45)_S-19.webp\",\"Angler-ST_100_(90)_S-19.webp\"]', '[{\"title\":\"HIGH LOAD CARRYING CAPABILITY,&lt;br class=&#039;hidden-xs&#039;&gt; STABILITY AND PUNCTURE RESISTANC\",\"description\":\"Twin steel belts provide increased strength for carrying heavy loads, &lt;br class=&#039;hidden-xs&#039;&gt;offers stability and puncture resistance\",\"image\":\"ANGLER-ST-100_FB1.webp\"},{\"title\":\"LONG-LIFE AND&lt;br class=&#039;hidden-xs&#039;&gt; IMPROVED FUEL ECONOMY\",\"description\":\"Special tread compound that provides low rolling resistance&lt;br class=&#039;hidden-xs&#039;&gt; and a long tread life.\",\"image\":\"ANGLER-ST-100_FB2_New.webp\"},{\"title\":\"HIGH STABILITY AND&lt;br class=&#039;hidden-xs&#039;&gt; DURABILITY\",\"description\":\"Use of full nylon overlay in all sizes provides &lt;br class=&#039;hidden-xs&#039;&gt;improved stability and durability.\",\"image\":\"ANGLER-ST-100_FB3.webp\"}]', '{\"sizes\":[{\"name\":\"us-angler-st-100\",\"size\":16,\"rim\":\"ST235\\/80R16\",\"li_s