(88, 1, 14, 16, 17, 31, 1, 'Dimax Classic', 'Dimax&lt;sup&gt;&lt;/sup&gt; Classic', 'us-dimax-classic-1', NULL, 0, 'The Dimax Classic is a touring tire specially designed and developed for classic cars. This range offers a combination of classic looks yet state-of-the-art pattern technology and the latest in materials sophistication that ensures the tire delivers exceptional handling, durability and comfort, while completely complimenting and adding to the overall aesthetic of your classic/vintage vehicle. Available in either a retro white sidewall or a sophisticated black sidewall finish.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;Road Hazard Warranty&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Dimax_Classic.webp', '[\"Dimax-Classic-0_S-19.webp\",\"Dimax-Classic-45-WSW_TS.webp\",\"Dimax-Classic-90-WSW_TS.webp\"]', '[{\"title\":\"HIGH MILEAGE\",\"description\":\"Specially formulated tread compound.\",\"image\":\"Dimax-Classic-FB-1.webp\"},{\"title\":\"DELIVERS SHORTER BRAKING DISTANCE\",\"description\":\"Touring tread pattern.\",\"image\":\"Dimax-Classic-FB-1-and-2.webp\"},{\"title\":\"CLASSIC AESTHETICS FOR CLASSIC\\/VINTAGE VEHICLES\",\"description\":\"Vintage tread and sidewall design available in either a black or retro white sidewall finish.\",\"image\":\"Dimax_Classic-Unit_thicker-sidewall.webp\"}]', '{\"sizes\":[{\"name\":\"us-dimax-classic-1\",\"size\":15,\"rim\":\"155R15\",\"li_sr\":\"82S\",\"lr\":\"-\",\"s_w\":\"WSW\",\"fuel\":null,\"weather\":null,\"noise_db\":null,\"eulabel\":null,\"exempted\":null},{\"name\":\"us-dimax-classic-1\",\"size\":15,\"rim\":\"165R15\",\"li_sr\":\"86H\",\"lr\":\"-\",\"s_w\":\"WSW\",\"fuel\":null,\"weather\":null,\"noise_db\":null,\"eulabel\":null,\"exempted\":null}],\"extra_cols\":{\"s_w\":\"S.W.\"},\"legends\":\"&lt;b&gt;L.I.&lt;\\/b&gt; = Load Index, &lt;b&gt;S.R.&lt;\\/b&gt; = Speed Rating, &lt;b&gt;L.R.&lt;\\/b&gt; = Load Range, &lt;b&gt;SW&lt;\\/b&gt; = Sidewall, &lt;b&gt;WSW&lt;\\/b&gt; = White Sidewall\\r\\n&lt;br&gt;&lt;b&gt;Speed Rating:&lt;\\/b&gt; &lt;b&gt;S&lt;\\/b&gt; = 112 mph,  &lt;b&gt;H&lt;\\/b&gt; = 130 mph\"}', NULL, NULL, '2025-01-11 13:38:30', '2025-04-24 06:51:04'),
(89, 1, 14, 16, 17, 24, 2, 'Renegade H/T Pro', 'Renegade&lt;sup&gt;&lt;/sup&gt; H/T Pro', 'us-renegade-ht-pro', NULL, 0, 'The Radar Renegade H/T Pro is a premium highway terrain tire engineered to deliver a quiet, comfortable ride with uncompromising durability and traction. Designed by Omni United in collaboration with renowned Italian design house GFG Style, led by legendary automotive designers Giorgetto and Fabrizio Giugiaro, the Renegade H/T Pro features a unique, functional and stylish design representing a perfect synergy of design and engineering. This advanced and feature packed range is extensively tested against premium brands and offers drivers comfort, high durability and mileage as well as premium performance on wet and dry roads.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;Up to 70,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Renegade-HT-Pro-featured.webp', '[\"IMG_01_HT_Pro_rim.webp\",\"IMG_3_HT_Pro_45_S.webp\",\"IMG_02_HT_Pro_rim.webp\"]', '[{\"title\":\"OMNICOMFORT COMPOUND \\u2013 SUPERIOR COMFORT, &lt;br class=&#039;hidden-xs&#039;&gt;MILEAGE AND PREMIUM PERFORMANCE\",\"description\":\"Superior tread and base compound provide the ultimate combination of comfort&lt;br class=&quot;hidden-xs&quot;&gt; and mileage. Modern elastomers and silica system deliver excellent wet and &lt;br class=&quot;hidden-xs&quot;&gt;dry performance.\",\"image\":\"Renegade-HT-Pro_FB_1.webp\"},{\"title\":\"UNIQUE LEAF INSPIRED TREAD DESIGN \\u2013 &lt;br class=&#039;hidden-xs&#039;&gt;QUIET AND FUEL EFFICIENT RIDE\",\"description\":\"Ultra-modern, noise optimized design for a quiet and comfortable &lt;br class=&quot;hidden-xs&quot;&gt;ride. Featuring a \\u201cleaf vein\\u201d inspired siping design for improved &lt;br class=&quot;hidden-xs&quot;&gt;rolling resistance.\",\"image\":\"Renegade-HT-Pro_FB_2.webp\"},{\"title\":\"SOLIDBRIDGE SHOULDER DESIGN \\u2013 &lt;br class=&#039;hidden-xs&#039;&gt;HIGH STABILITY AND EXCELLENT TRACTION\",\"description\":\"Shoulder blocks connected with tie bars and bridges provide great stability. This &lt;br class=&quot;hidden-xs&quot;&gt;enables the use of partly open shoulder design which delivers unbeatable traction &lt;br class=&quot;hidden-xs&quot;&gt;on many surfaces including gravel and snowy roads.\",\"image\":\"Renegade-HT-Pro_FB_3.webp\"},{\"title\":\"THE CIRCLE OF TREAD LIFE \\u2013 &lt;br class=&#039;hidden-xs&#039;&gt;A UNIQUE TREAD DEPTH INDICATOR\",\"description\":\"A unique safety feature that provides awareness about safety and tire replacement. When &lt;br class=&quot;hidden-xs&quot;&gt;the tire is new, this indicator is a full circle, as the tire wears down, the indicator &lt;br class=&quot;hidden-xs&quot;&gt;begins to fade and totally disappears when the tread depth is at 20%.\",\"image\":\"Renegade-HT-Pro_FB_4.webp\"},{\"title\":\"AQUEDUCT GROOVES FEATURING &lt;br class=&#039;hidden-xs&#039;&gt;STONE-EJECTOR-TECHNOLOGY \\u2013 SAFETY IN WET AND DURABILITY\",\"description\":\"Ultra-smooth surface of the groove bottom in combination with optimized groove angles help in &lt;br class=&quot;hidden-xs&quot;&gt;water evacuation to provide aquaplaning resistance. Stone-ejectors help prevent stones from &lt;br class=&quot;hidden-xs&quot;&gt;getting lodged in the tread and causing subsequent damage.\",\"image\":\"Renegade-HT-Pro_FB_5.webp\"},{\"title\":\"THICK SKIN SIDEWALL \\u2013 &lt;br class=&#039;hidden-xs&#039;&gt;HIGH DURABILITY AND PROTECTION\",\"description\":\"Fortified sidewall construction with added cut and chip &lt;br class=&quot;hidden-xs&quot;&gt;resistant components provide high durability. All light truck &lt;br class=&quot;hidden-xs&quot;&gt;sizes come with a 3-ply sidewall.\",\"image\":\"Renegade-HT-Pro_FB_6.webp\"}]', '{\"sizes\":[{\"name\":\"us-renegad