(91, 1, 14, 16, 17, 24, 2, 'Renegade A/T Pro', 'Renegade&lt;sup&gt;&lt;/sup&gt; A/T Pro', 'renegade-at-pro', NULL, 0, 'The Renegade A/T Pro is a premium all-terrain range engineered for drivers that need exceptional off-road performance while giving a quiet, smooth on-road ride. This range offers a combination of increased off-road grip and handling with excellent traction. The tires utilize a special silica based tread compound that offers outstanding cut and chip resistance along with the all-new innovative M-sipe, designed for Maximum grip in all conditions. Each tire features a Rattlesnake inspired dual sidewall design which allows you to customize the look of your vehicle. The fang side features a snake head design and fangs for added traction and the rattle side features a snake tail design for added protection.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;50,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Renegade_AT-pro-us.webp', '[\"Renegade-AT-pro-1-(0)_S-19.webp\",\"Renegade-AT-pro-1-(45)_S-19.webp\",\"Renegade-AT-Pro-1-(90)_S-19.webp\",\"renegade_at_pro_45_tailside.webp\",\"renegade_at_pro_90_tailside.webp\"]', '[{\"title\":\"INCREASED STABILITY AND HANDLING\",\"description\":\"Wide center block design ensures no pattern movement  &lt;br class=&quot;hidden-xs&quot;&gt;on-road and a smooth, quiet ride and even wear\",\"image\":\"Renegade-AT-Pro_FB-1.webp\"},{\"title\":\"EXCEPTIONAL ALL TERRAIN TRACTION AND STABILITY\",\"description\":\"Optimized interlocking tread block design ensures the &lt;br class=&quot;hidden-xs&quot;&gt;pattern works in harmony with the terrain\",\"image\":\"Renegade-AT-Pro_FB-2.webp\"},{\"title\":\"OUTSTANDING CUT AND CHIP RESISTANCE\",\"description\":\"Special silica based compound that provides cut and &lt;br class=