(92, 1, 14, 16, 17, 24, 2, 'Renegade A/T5', 'Renegade&lt;sup&gt;&lt;/sup&gt; A/T5', 'us-renegade-a-t5', NULL, 0, 'The Radar Renegade A/T5 is an exceptional all-terrain tire range that is designed for people who like to venture off-road but need an assured ride on-road as well. This range offers increased stability and resistance to punctures. It also features the innovative and unique stone-ejector-technology that prevents stones from drilling and lodging in the tread. Most sizes have the Three Peak Mountain Snowflake symbol (3PMSF) and are approved for use in snow.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;50,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Renegade_AT5-us.webp', '[\"Renegade_AT5_0_S-19.webp\",\"Renegade-AT5_45_S-19.webp\",\"Renegade-AT5_90_S-19.webp\"]', '[{\"title\":\"ENHANCED STABILITY, HANDLING AND EVEN TREADWEAR\",\"description\":\"Wide center tread blocks help balance the weight &lt;br class=&quot;hidden-xs&quot;&gt;distribution and ensure the tread wears evenly.\",\"image\":\"US-Renegade-AT5_FB-1.webp\"},{\"title\":\"EXCEPTIONAL ALL TERRAIN TRACTION\",\"description\":\"Optimized tread block sizes and shapes with multiple lateral &lt;br class=&quot;hidden-xs&quot;&gt;grooves and angled sipes ensure superb traction on all terrains.\",\"image\":\"US-Renegade-AT5_FB-2.webp\"},{\"title\":\"INCREASED STABILITY AND RESISTANCE TO PUNCTURES\",\"description\":\"Robust 3-ply construction reduces the risk of punctures and &lt;br class=&quot;hidden-xs&quot;&gt;gives sure-footed handling on all surfaces.\",\"image\":\"US-Renegade-AT5_FB-3-1.webp\"},{\"title\":\"REDUCED LODGING AND DRILLING OF&lt;br class=&#039;hidden-xs&#039;&gt; STONES IN THE TREAD\",\"description\":\"Innovative stone-ejector-technology\",\"image\":\"US-Renegade-AT5_FB-4-1.webp\"}]', '{\"sizes\":[{\"name\":\"us-re