(93, 1, 14, 16, 17, 24, 2, 'Renegade R/T', 'Renegade&lt;sup&gt;&lt;/sup&gt; R/T', 'us-renegade-rt', NULL, 0, 'The Renegade R/T is a premium rugged terrain range that is designed to give exceptional off-road performance coupled with on-road comfort and sophistication. On-road, this tire gives drivers superior handling with a quiet and smooth ride, while off-road it has the capability to go anywhere that a pure M/T tire can. All sizes come with a dual sidewall design that gives drivers a choice of either the mud penetrating sidewall with dagger shaped lugs or the flaming demon design with wedge-shaped lugs. These lugs offer added traction and sidewall protection.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;Up to 45,000 Miles Treadwear Limited Warranty&lt;br&gt;\r\nRoad Hazard Warranty&lt;br&gt;\r\n30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Renegade_RT-PLUS-us.webp', '[\"Renegade_RT_0-1.webp\",\"Renegade_RT_(45)_S-19(1).webp\",\"Renegade_RT_(90)-Dagger_S-19.webp\",\"Renegade_RT_(90)-Demon_S-19.webp\"]', '[{\"title\":\"EXCEPTIONAL ALL-TERRAIN TRACTION\",\"description\":\"Optimized tread block sizes and shapes with multiple lateral&lt;br class=&quot;hidden-xs&quot;&gt; grooves and angled sipes ensure superb traction on all terrains.\",\"image\":\"Renegade-RT+(Red-2)-1.webp\"},{\"title\":\"INCREASED STABILITY AND RESISTANCE TO PUNCTURES\",\"description\":\"Robust 3-ply construction reduces the risk of punctures and &lt;br class=&quot;hidden-xs&quot;&gt;gives sure-footed handling on all surfaces.\",\"image\":\"Renegade-RT+(Red-1)-2.webp\"},{\"title\":\"ENHANCED STABILITY, HANDLING AND EVEN TREADWEAR\",\"description\":\"Wide center tread blocks help balance the weight distribution &lt;br class=&quot;hidden-xs&quot;&gt;and ensure the tread wears evenly.\",\"image\":\"Renegade-RT+(Red-3)-3.webp\"},{\"title\":\"DUAL SIDEWALL DESIGN\",\"des