(94, 1, 14, 16, 17, 24, 2, 'Renegade R7 M/T', 'Renegade&lt;sup&gt;&lt;/sup&gt; R7 M/T', 'us-renegade-r7-mt', NULL, 0, 'The Renegade R7 M/T is a mud terrain tire that has been designed specifically for extreme off-road applications. This range is designed to fit SUVs and light trucks and is suitable for vehicles with lift-kits. It features a reinforced 3-ply casing for high durability and state-of-the-art Stone-Ejector-Technology which prevents stone retention and subsequent tire damage. An ideal choice for drivers who want no compromise with off-road traction and handling.', 'Renegade_R7-us.webp', '[\"Renegade_R7_(0)_S-19-1.webp\",\"Renegade_R7_45_S-19.webp\",\"Renegade_R7_(90)_S-19.webp\"]', '[{\"title\":\"OUTSTANDING TRACTION IN &lt;br class=&quot;hidden-xs&quot;&gt;ALL CONDITIONS\",\"description\":\"Aggressive pattern featuring a high void &lt;br class=&quot;hidden-xs&quot;&gt;ratio and open shoulder design.\",\"image\":\"US-Renegade-R7-FB-1.webp\"},{\"title\":\"ENHANCED DURABILITY\",\"description\":\"Unique stone-ejector-technology prevents stones &lt;br class=&quot;hidden-xs&quot;&gt;from drilling and lodging in the tread and &lt;br class=&quot;hidden-xs&quot;&gt;causing damage to the casing.\",\"image\":\"US-Renegade-R7-FB-2-1.webp\"},{\"title\":\"SUPERIOR OVERALL &lt;br class=&quot;hidden-xs&quot;&gt;RESISTANCE TO DAMAGE\",\"description\":\"Reinforced 3-ply &lt;br class=&quot;hidden-xs&quot;&gt;casing construction.\",\"image\":\"US-Renegade-R7-FB-3-1.webp\"},{\"title\":\"ENHANCED TREAD LIFE AND BRAKING &lt;br class=&quot;hidden-xs&quot;&gt;ON ALL SURFACES\",\"description\":\"Special tread compound and &lt;br class=&quot;hidden-xs&quot;&gt;wide footprint.\",\"image\":\"US-Renegade-R7-FB_4.webp\"}]', '{\"sizes\":[{\"name\":\"us-renegade-r7-mt\",\"size\":22,\"rim\":\"33x12.50R22LT\",\"li_sr\":\"114Q\",\"lr\":\"F\",\"s_w\":\"-\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \"},{\"name\":\"us-renegade-r7-mt\",\"size\":22,\"rim\":\"35x12.50R22LT\",\"li_sr\":