(95, 1, 14, 16, 17, 24, 2, 'Renegade X', 'Renegade&lt;sup&gt;&lt;/sup&gt; X', 'us-renegade-x', NULL, 0, 'The Renegade-X is a top-of-the-line, premium extreme terrain tire range from Radar Tires. This innovative &quot;stealth&quot; inspired tire is born out of the partnership between Radar Tires and leading Italian automotive design house GFG Style. This feature-packed range is designed and engineered for drivers that need extreme off-road performance on mud, rocks, gravel and sand while offering durability and an aggressive aesthetic that enthusiasts crave.\r\n&lt;h4 class=&quot;bottommargin-xs&quot;&gt;WARRANTY&lt;/h4&gt;\r\n&lt;p&gt;30-Day Satisfaction Guarantee&lt;br&gt;\r\n&lt;a target=&quot;_blank&quot; href=&quot;:url-us-warranty&quot;&gt;View Details&lt;/a&gt;&lt;/p&gt;', 'Renegade_X.webp', '[\"Renegade-X_0.webp\",\"Renegade-X_45.webp\",\"Renegade-X_90.webp\"]', '[{\"title\":\"EXTREME OFF-ROAD TRACTION\",\"description\":\"High void-to-lug ratio, deep side blocks and a specially formulated &lt;br&gt;Rock-Crawl tread compound provide exceptional traction and grip on &lt;br&gt;rocks, gravel, mud and soft soil. Mud-rescue shoulder provides &lt;br&gt;additional traction that helps pull the vehicle out of mud.\",\"image\":\"apac-Feature-and-benefit_1.webp\"},{\"title\":\"ENHANCED DURABILITY\",\"description\":\"A unique combination of stone ejectors and &lt;br&gt;serrations on the bottom tread add an &lt;br&gt;additional layer of reinforcement to increase &lt;br&gt;puncture resistance.\",\"image\":\"apac-Feature-and-benefit_2-1.webp\"},{\"title\":\"TOUGHER SIDEWALLS\",\"description\":\"High turn-up 3-ply sidewall construction combined with &lt;br&gt;aggressive \\u201cstealth\\u201d shaped sidewall lugs provide biting edges &lt;br&gt;for additional grip and traction, and provide protection from &lt;br&gt;external sidewall damage.\",\"image\":\"apac-Feature-and-benefit_3.webp\"},{\"title\":\"LONG TREAD LIFE\",\"description\":\"Specially formulated tread compound &lt;br&gt;combined with tie bars provide lateral&lt;br&gt; stability, promote even wear and &lt;br&gt;increases longevity.\",\"image\":\"apac-Feature-and-benefit_4.webp\"},{\"title\":\"ON-ROAD COMFORT\",\"description\":\"Optimised tread pattern design &lt;br&gt;reduces noise for a quieter &lt;br&gt;and more comfortable on-road &lt;br&gt;ride.\",\"image\":\"apac-Feature-and-benefit_5.webp\"}]', '{\"sizes\":[{\"name\":\"eu-renegade-x\",\"size\":\"24\",\"rim\":\"37x13.50R24LT\",\"li_sr\":\"124Q\",\"lr\":\"F\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"22\",\"rim\":\"33x12.50R22LT\",\"li_sr\":\"114Q\",\"lr\":\"F\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"22\",\"rim\":\"35x12.50R22LT\",\"li_sr\":\"121Q\",\"lr\":\"F\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"22\",\"rim\":\"37x13.50R22LT\",\"li_sr\":\"128Q\",\"lr\":\"F\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"20\",\"rim\":\"LT295\\/65R20\",\"li_sr\":\"129\\/126Q\",\"lr\":\"E\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"20\",\"rim\":\"33x12.50R20LT\",\"li_sr\":\"114Q\",\"lr\":\"E\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"20\",\"rim\":\"33x12.50R20LT\",\"li_sr\":\"119Q\",\"lr\":\"F\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"eu-renegade-x\",\"size\":\"20\",\"rim\":\"35x12.50R20LT\",\"li_sr\":\"121Q\",\"lr\":\"E\",\"fuel\":\"- \",\"weather\":\"- \",\"noise_db\":\"- \",\"eulabel\":\"- \",\"exempted\":\"- \"},{\"name\":\"e