(96, 1, 14, 16, 17, 23, 2, 'Dimax SPORT A/S', 'Dimax&lt;sup&gt;&lt;/sup&gt;  SPORT A/S', 'us-dimax-sport-as', NULL, 1, 'The Dimax Sport A/S is a premium sport tyre engineered to deliver uncompromising safety, performance and control. Designed by Omni United in collaboration with renowned Italian design house GFG Style, led by legendary automotive designers Giorgetto and Fabrizio Giugiaro, the Dimax Sport A/S features a unique, functional and stylish design representing a perfect synergy of design and engineering. This advanced and feature packed range is extensively tested against premium brands and offers drivers excellent wet grip, handling, low rolling resistance and a quiet ride.', 'Dimax-AS-coming-soon-1.webp', '[\"Dimax-AS-45-R-1.webp\"]', '[]', '{\"sizes\":[],\"extra_cols\":[],\"legends\":\"&lt;b&gt;L.I.&lt;\\/b&gt; = Load Index, &lt;b&gt;S.R.&lt;\\/b&gt; = Speed Rating, &lt;b&gt;L.R.&lt;\\/b&gt; = Load Range , &lt;b&gt;M+S&lt;\\/b&gt; = Mud &amp; Snow, &lt;b&gt;POR&lt;\\/b&gt; = Professional Off-Road tyre.\\r\\n&lt;br&gt;&lt;b&gt;Speed Rating:&lt;\\/b&gt; &lt;b&gt;M&lt;\\/b&gt; = 81 MPH, &lt;b&gt;N&lt;\\/b&gt; = 87 MPH, &lt;b&gt;P&lt;\\/b&gt; = 93 MPH, &lt;b&gt;Q&lt;\\/b&gt; = 99 MPH, &lt;b&gt;R&lt;\\/b&gt; = 106 MPH, &lt;b&gt;S&lt;\\/b&gt; = 112 MPH, &lt;b&gt;T&lt;\\/b&gt; = 118 MPH, &lt;b&gt;U&lt;\\/b&gt; = 124 MPH, &lt;b&gt;H&lt;\\/b&gt; = 130 MPH, &lt;b&gt;V&lt;\\/b&gt; = 149 MPH, &lt;b&gt;W&lt;\\/b&gt; = 168 MPH, &lt;b&gt;Y&lt;\\/b&gt; = 186 MPH | &lt;b&gt;Load Range:&lt;\\/b&gt; &lt;b&gt;SL&lt;\\/b&gt; = Standard Load, &lt;b&gt;XL&lt;\\/b&gt; = Extra Load, &lt;b&gt;C&lt;\\/b&gt; = 6-ply, &lt;b&gt;D&lt;\\/b&gt; = 8- ply, &lt;b&gt;E&lt;\\/b&gt; = 10- ply, &lt;b&gt;F&lt;\\/b&gt; = 12- ply\"}', 1, NULL, '2025-04-23 08:11:12', '2025-04-25 05:51:12'),
(97, 1, 14, 16, 17, 23, 2, 'All Season GT', 'All Season GT', 'us-all-season-gt', NULL, 7, 'The All Season GT is a premium all-season grand touring tire engineered to deliver exceptional performance, safety, durability and comfort. Designed by Omni United in collaboration with renowned Italian design house GFG Style, the All Season GT features a unique, functional and stylish design representing a perfect synergy of design and engineering. This advanced and feature-packed range is extensively tested against premium brands and offers drivers excellent traction, precise handling, excellent wet grip and exceptional mileage making it the ideal choice for drivers looking for high performance and total assurance in all seasons. The All Season GT offers popular passenger car and SUV fitments and all sizes carry the EVC marking on the sidewall identifying the tyre as compatible with both Electric Vehicles(EV) and Plug-in hybrid vehicles.', 'All-Season-GT-featured.webp', '[\"All-Season-GT-0.webp\",\"All-Season-GT-45.webp\",\"All-Season-GT-90.webp\"]', '[{\"title\":\"OMNIPERFORMANCE COMPOUNDING\",\"description\":\"Unique compound that combines wet grip and dry handling &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;with comfort and mileage. Modern elastomer base and high &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;Silica content provide low rolling resistance for higher &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;fuel saving.\",\"image\":\"All-Season-GT_FB_1.webp\"},{\"title\":\"HARMONIZED SYMMETRIA TREAD DESIGN \\u2013 &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;BY GFG STYLE ITALY\",\"description\":\"Ultra-simple design with \\u201cS\\u201d shaped center &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;blocks and optimized pitch sequencing creates &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;a smooth and silent ride.\",\"image\":\"All-Season-GT_FB_2.webp\"},{\"title\":\"AQUEDUCT GROOVES\",\"description\":\"These are ultra-smooth and shiny channels which, in combination &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;with optimised groove wall angles help in efficiently evacuating &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;water from the tread, enable better Hydroplaning resistance, &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;thereby enhancing safety.\",\"image\":\"All-Season-GT_FB_5.webp\"},{\"title\":\"BACKBONE CENTER RIBS\",\"description\":\"Side-alternating siping creates a unique &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;combination of stability, steering precision and &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;traction. Foundation tie bars strengthen the ribs &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;and improve durability.\",\"image\":\"All-Season-GT_FB_6.webp\"},{\"title\":\"THE CIRCLE OF TREAD LIFE \\u2013 A UNIQUE TREAD DEPTH INDICATOR\",\"description\":\"A unique safety feature that gives easy and accurate reading &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;of the remaining tread depth. It starts with a full circle &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;indicating 100% tread depth and totally disappears at 1.6mm &lt;br class=&quot;&#039;hidden-xs&#039;&quot;&gt;remaining tread depth.\",\"image\":\"All-Season-GT_FB_4.webp\"}]', '{\"sizes\":[{\"name\":\"us-all-season-gt\",\"size\":20,\"rim\":\"245\\/50R20\",\"li_sr\":\"102W\",\"lr\":\"-\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":20,\"rim\":\"265\\/45R20\",\"li_sr\":\"108W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":20,\"rim\":\"275\\/55R20\",\"li_sr\":\"117V\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":20,\"rim\":\"275\\/60R20\",\"li_sr\":\"115V\",\"lr\":\"-\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":19,\"rim\":\"235\\/40R19\",\"li_sr\":\"96W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":19,\"rim\":\"235\\/55R19\",\"li_sr\":\"105V\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"225\\/40R18\",\"li_sr\":\"92W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"225\\/45R18\",\"li_sr\":\"95W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"225\\/50R18\",\"li_sr\":\"99W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"225\\/55R18\",\"li_sr\":\"102V\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"225\\/60R18\",\"li_sr\":\"104W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"235\\/40R18\",\"li_sr\":\"95W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"235\\/45R18\",\"li_sr\":\"98W\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"235\\/50R18\",\"li_sr\":\"101V\",\"lr\":\"XL\",\"fuel\":\"-\",\"weather\":\"-\",\"noise_db\":\"-\",\"eulabel\":\"-\",\"exempted\":\"-\"},{\"name\":\"us-all-season-gt\",\"size\":18,\"rim\":\"235\\/55R18\",\